use std::collections::HashMap;

fn main() {
    let s1 = "leetcode".to_string();
    let s2 = "aabb".to_string();
    let s3 = "ccaabb".to_string();
    let result = first_uniq_char(s2);
    println!("Result '{}'", result);
}

fn first_uniq_char(s: String) -> i32 {
    let mut map: HashMap<char, i32> = HashMap::new();

    for c in s.chars() {
        let upd = map.entry(c).or_insert(0);
        *upd += 1;
    }

    let mut unique_char_index = -1;
    for (i, c) in s.char_indices() {
        let repetion = map.get_key_value(&c).unwrap().1;
        if repetion == &1 {
            unique_char_index = i as i32;
            break;
        }
    }

    unique_char_index
}

#[cfg(test)]
mod test {

    use crate::first_uniq_char;

    #[test]
    fn test_a_string_matches_in_the_beginning() {
        let s = "leetcode".to_string();
        assert_eq!(0, first_uniq_char(s));
    }
    #[test]
    fn test_a_string_matches() {
        let s = "loveleetcode".to_string();
        assert_eq!(2, first_uniq_char(s));
    }
    #[test]
    fn test_a_string_without_matches() {
        let s = "aabb".to_string();
        assert_eq!(-1, first_uniq_char(s));
    }
    #[test]
    fn test_for_performance() {
        let s = "".to_string();
        // No assertion, just for performance testing.
        first_uniq_char(s);
    }
}
